import { Card, Button, Form } from 'react-bootstrap';
import './css.css';

export default function ListVote(props) {
  let changeMode = props.action;
  const [listVote, setlistVote] = useState([]);

  React.useEffect(() => {
    setlistVote([1, 2, 3]);
  });
  

  return (
    <div className="warp-content">
      <h1>list vote</h1>
    </div>
  );
}
